import React from 'react'
import Link from 'next/link'
import '../styles.css' 

import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Attraction from '../components/Attraction'
import { CardGroup } from 'react-bootstrap';

type attr = {
	id: number,
	name: string,
	tags: string[],
	number_of_reviews: number,
	main_photo_url: string
	rating: number,
	location_lng: number,
	location_lat: number,
	opening_hours: number[],
	created: string,
	source: string,
	address: string,
	about: number,
	order_page: any,
	is_free: boolean,
	price: any
}

const indexPage = () => {
	const attractionsData: attr[] = require('../data/attractions_museums_tlv.json')
	return (
		<div>
			<h1>Hello Bridgify!! :)</h1>
			<p>go to <Link href="/auth"><a>Auth</a></Link></p>
			{/* <CardGroup style={{display:'flex',flexDirection:'column'}}> */}
			<CardGroup style={{}}>
			{attractionsData.map(attr =>
				<Attraction
					key={attr.id}
					name={attr.name}
					number_of_reviews={attr.number_of_reviews}
					rating={attr.rating}
					tags={attr.tags}
					imgUrl={attr.main_photo_url}
				></Attraction>)}
				</CardGroup>
		</div>
	)
}


export default indexPage

//  1. Create an index web page which contains a designed list of attractions
// a.import JSON file
// b. map it into components
// c. design the components
